import { render } from '@testing-library/react';
import React from 'react';
import './App.css';
import ReactClass from './Component'
import MeuNome from './MeuNome';

function App() {
  render()

  const myUser = {
    nome: Danilo,
    sobrenome: Fernandes
  }

  return (
  <div>
  <h1>Hello, World!</h1>
  <h3>Varg Vkiernes</h3>
  < MeuNome nome={ myUser } Sobrenome={ myUser } /> 
  < ReactClass />
  </div>
  )
}
export default App;
